import React from 'react';

const Doughnut2d = ({chartData}) => {
  const chartConfigs = {
    type: 'column3d',
    width: '100%',
    // height: '100%',
    dataFormat: 'json',
    dataSource: {
      "chart": {
        "caption": "Most Popular",
        "xAxisName": "Stars",
        "yAxisName": "Repos",  
        "theme": "fusion",
        "decimals": "0"
      },
      "data": chartData
    },
  };
  return <ReactFC {...chartConfigs} />;
}


export default Doughnut2d;

